import gifrom gi.repository import Gtkfrom controllers.MainMenuController import MainMenuControllerfrom models.dataMock import DataAcessMock# from gi.repository import Adwfrom views.mainmenu import MainMenugi.require_version('Gtk', '4.0')gi.require_version('Adw', '1')if __name__ == "__main__":    app = Gtk.Application(application_id='DoomModManager')    appController = MainMenuController(DataAcessMock())    def on_activate(app):        """For activating application."""        win = MainMenu(app, appController)        win.present()    app.connect('activate', on_activate)    app.run(None)